import {createMuiTheme} from '@material-ui/core';

const theme = createMuiTheme({
    palette: {
        typography: {
            fontFamily: 'Montserrat',
        },
        primary: {
            main: '#083D77',
        },
        secondary: {
            main: '#100000'
        },
        text: {
            primary: '#EBEBD3',
        }
    },

});

export default theme;
